import React from "react";
import Todo from "./Todo";
const TodoList = ({ todos, setTodos }) => {
  return (
    <div>
      {todos.map((todo) => {
        <li key={todo.id}>
          <Todo todo={todo} />
        </li>;
      })}
    </div>
  );
};

export default TodoList;
